import O_que_e_bitcoin from './cards_modall/index'

export default function Blog() {
 
    return (

       <View style={styles.caRd}>

           <O_que_e_bitcoin/>
           <Como_funciona_o_bitcoin/>

       </View>
  
    )
  
}
